use std::cell::RefCell;
use std::rc::Rc;
impl Solution { pub fn is_symmetric(root: Option<Rc<RefCell<TreeNode>>>) -> bool { if let Some(r) = root { let r = r.borrow(); return Self::mirror(&r.left, &r.right); } true } pub fn mirror( t1: &Option<Rc<RefCell<TreeNode>>>, t2: &Option<Rc<RefCell<TreeNode>>> ) -> bool { match (t1, t2) { (&None, &None) => true, (Some(n1), Some(n2)) => { let (n1, n2) = (n1.borrow(), n2.borrow()); n1.val == n2.val && Self::mirror(&n1.left, &n2.right) && Self::mirror(&n2.left, &n1.right) } _ => false, } }
}

