use std::cell::RefCell;
use std::rc::Rc;
impl Solution { pub fn max_depth(root: Option<Rc<RefCell<TreeNode>>>) -> i32 { Self::ruler(&root, 0) } fn ruler(t: &Option<Rc<RefCell<TreeNode>>>, d: i32) -> i32 { if let Some(t) = t { let t = t.borrow(); return std::cmp::max( Self::ruler(&t.left, d + 1), Self::ruler(&t.right, d + 1) ); } d }
}

