use std::cell::RefCell;
use std::rc::Rc;
impl Solution { pub fn is_balanced(root: Option<Rc<RefCell<TreeNode>>>) -> bool { Self::bd(&root).is_ok() } fn bd(r: &Option<Rc<RefCell<TreeNode>>>) -> Result<i32, ()> { if let Some(r) = r { let lt = Self::bd(&r.borrow().left)?; let rt = Self::bd(&r.borrow().right)?; if (lt - rt).abs() > 1 { Err(()) } else { Ok(1 + std::cmp::max(lt, rt)) } } else { Ok(0) } }
}

